import React, { useEffect, useState } from "react";

import Post from "../../../Components/System/Post";

const MyPosts = () => {

    const [posts, setPosts] = useState([]);

    useEffect(() => {
        const getPosts = () => {
            const data = [
                {
                    id: 1,
                    user: 'Daniel Arruda',
                    text: 'Ol치, pessoal. Bom dia!',
                    datetime: '14:39 08/03/2022'
                },
                {
                    id: 2,
                    user: 'Maria Cardoso',
                    text: 'Ol치, amigos. Bom dia!',
                    datetime: '14:42 08/03/2022'
                }
            ];

            setPosts(data);
            console.log(posts);
        }

        getPosts();
    }, []);

    return (
        <>
            <h1>Meus Posts</h1>

            {posts.map(post => {
                return (
                    <Post dataPost={post} key={post.id} />
                )
            })}
        </>
    );
}

export default MyPosts;
